import React from "react";
import { BiChevronLeft, BiRightArrowCircle } from "react-icons/bi";

import { Col, Row } from "react-bootstrap";
import {
    BiPhoneCall,
    BiEnvelope,
  } from "react-icons/bi";
import LocationIcon from "../../Assests/Images/icon/location.svg"; 

import Heading from "../Heading";

import CoverImg from "../../Assests/Images/background/cover.png";
import UserImg from "../../Assests/Images/avatar/female.svg";

function UserProfile({ setshowSubContentClick }) {
  return (
    <div>
      <h1
        onClick={() => setshowSubContentClick(0)}
        className="me-2 d-block d-sm-none"
      >
        <BiChevronLeft className="d-inline" />
        <Heading content="My Profile" design="h1 d-inline-block" />
      </h1>
      <Row className="mx-auto my-2">
        <Col sm={12}>
          <img
            src={CoverImg}
            class="img-fluid border border-1 w-100 coverImage"
          />
        </Col>
        </Row>
        <Row>
        <Col sm={12} className="position-relative">
          <img
            src={UserImg}
            className=" border rounded-circle bg-white position-absolute top-0 end-0 translate-middle"
            width="100"
            height="100"
          />
        </Col>
        <Col sm={2} md={12} lg={12} className="mx-3">
        <Heading content="Samiksha Moghan" design="h5 text-truncate text-capitalize"/>
        <p className="m-0 text-start fs-7 text-capitalize"> <BiEnvelope className="icon"/> EMAIL HERE </p>
        <p className="m-0 text-start fs-7 text-capitalize"><BiPhoneCall className="icon" /> 010875444567899876</p>
        <p className="m-0 text-start fs-7 text-capitalize"><LocationIcon className="icon"/>fdvbf</p>
        </Col>
      </Row>
    </div>
  );
}

export default UserProfile;
